import React from 'react';
import './Song.css';

const Song = (props) => {
  return (
    <div
      className="Song"
      onClick={() => props.playSong(props.song.id)}
    >
      <span>{props.song.title}</span>
      <span>{props.song.singer}</span>
    </div>
  )
}

export default Song;
